            <div className="footer">
                <h6>
                    Vir podatkov: <a href="https://www.avp-rs.si/">avp-rs.si</a>
                </h6>
                <br/>
               <p>
                    Kontakt: info@varno-domov.si
               </p>
            </div>
        );
    }
}
